(32, 1, 'contact us', '<!-- Start Breadcrumb \r\n    ============================================= -->\r\n    <div class=\"breadcrumb-area gradient-bg bg-cover shadow dark text-light text-center\" style=\"background-image: url(assets/img/banner/24.jpg);\">\r\n        <div class=\"container\">\r\n            <div class=\"row\">\r\n                <div class=\"col-lg-8 offset-lg-2\">\r\n                    <h1>Contact Us</h1>\r\n                    <ul class=\"breadcrumb\">\r\n                        <li><a href=\"index.html\"><i class=\"fas fa-home\"></i> Home</a></li>\r\n                        <li class=\"active\">Contact</li>\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!-- End Breadcrumb -->\r\n\r\n    <!-- Start Contact Area\r\n    ============================================= -->\r\n    <div class=\"contact-area default-padding-top\">\r\n        <div class=\"container\">\r\n            <div class=\"contact-items\">\r\n                <div class=\"row\">\r\n                    \r\n                    <div class=\"col-lg-8 left-item\">\r\n                        <div class=\"content\">\r\n                            <h2>Send a message</h2>\r\n                            <form action=\"https://validthemes.net/site-template/dustra/assets/mail/contact.php\" method=\"POST\" class=\"contact-form\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-lg-12\">\r\n                                        <div class=\"form-group\">\r\n                                            <input class=\"form-control\" id=\"name\" name=\"name\" placeholder=\"Name\" type=\"text\">\r\n                                            <span class=\"alert-error\"></span>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                                <div class=\"row\">\r\n  